import './App.css';
import  MiLista from '../lista/MiLista';
import Header from '../header/Header.js';
import Footer from '../footer/Footer.js';
import React from 'react';
import Form from './Form.js';


class App extends React.Component {
    state = {
      incidencias: [{
        id_incidencias: 1,
        id_usuario: "felipeobaya",
        titulo: "Proyecto averia",
        descripcion: "Proyecto averiado en el aula 2",
        categoria: "Hardware",
        nivel_urgencia: "Media",
        fecha_registro: "2025-10-20",
        estado: "Abierto",
        ubicacion: "B205"
    },
    {
        id_incidencias: 2,
        id_usuario: "felipeobaya",
        titulo: "Proyecto averia",
        descripcion: "Ordenador no enciende",
        categoria: "Hardware",
        nivel_urgencia: "Baja",
        fecha_registro: "2025-10-20",
        estado: "Abierto",
        ubicacion: "B205"

    },
   ]};


  render(){
    return (
      <div className="App">
        <Header/>
          <h1>Mi aplicacion </h1>
          <div className="Parrafo">
            <p>Este es mi contenido de la app</p>
            <MiLista incidencias={this.state.incidencias}/>
            <Form/>
          </div>
          <Footer/>
      </div>
    );
  }
}

export default App;
